properties.code:
/**
                Executes a prepared query on the FHIR database and returns a CachedRowSet.

                @param {String} expression - The prepared statement to be executed.
                @param {Array} parameters - The parameters for the prepared statement.
                @param {DatabaseConnection} dbConn - Optionally provide a specific connection
                object.
                @return {CachedRowSet} The result of the query, as a CachedRowSet.
                */
                function executeCachedQuery(expression, parameters, dbConn) {
                return executeOperation('executeCachedQuery', expression, parameters,
                dbConn);
                }

/**
                Retrieves the FHIR database connection from the global channel map, creating a new
                one if necessary.

                @param {Boolean} recreate - If true, the connection will always be closed and
                created anew.
                @return {DatabaseConnection} The database connection object.
                */
                function getFHIRDBConnection(recreate) {
                var dbConn = $gc('dbConn');

                if (!dbConn || recreate) {
                if (dbConn) {
                try {
                dbConn.close();
                } catch (e) {}
                }
                dbConn = createFHIRDBConnection();
                $gc('dbConn', dbConn);
                }

                return dbConn;
                }

                function createFHIRDBConnection() {
                return
                DatabaseConnectionFactory.createDatabaseConnection($('fhirDBDriver'),
                $('fhirDBUrl'), $('fhirDBUsername'),
                $('fhirDBPassword'));
                }

                function executeOperation(operation, expression, parameters, dbConn) {
                var createDbConn = typeof dbConn == 'undefined';
                if (createDbConn) {
                dbConn = getFHIRDBConnection();
                }
                var attempts = 0;
                var maxAttempts = NumberUtils.toInt($('fhirDBMaxRetries') + '',
                0) + 1;

                while (attempts < maxAttempts) {
                attempts++;

                try {
                if (parameters) {
                for (var i in parameters) {
                var param = parameters[i];
                if (param instanceof Number) {
                parameters[i] = new java.lang.Integer(param);
                } else if (param instanceof java.util.Date) {
                parameters[i] = convertDateParameter(param);
                }
                }

                return dbConn[operation](expression, java.util.Arrays.asList(parameters));
                } else {
                return dbConn[operation](expression);
                }
                } catch (e) {
                logger.info('Error executing statement, checking if valid...');
                var throwException = false;

                try {
                dbConn.executeCachedQuery('SELECT 1');
                } catch (e2) {
                if (createDbConn) {
                logger.info('Connection invalid, recreating...');

                try {
                dbConn = getFHIRDBConnection(true);
                } catch (e3) {
                throwException = true;
                }
                } else {
                throwException = true;
                }
                }

                if (attempts >= maxAttempts) {
                throwException = true;
                }

                if (throwException) {
                var errorMessage = 'Unable to execute statement.\n';
                errorMessage += 'Expression: ' + expression + '\n';
                if (parameters) {
                errorMessage += 'Parameters: ' +
                java.util.Arrays.asList(parameters).toString();
                }
                logger.error(errorMessage, e.javaException);
                throw e;
                }

                java.lang.Thread.sleep(1000);
                }
                }
                }

                function convertDateParameter(date) {
                var dbType = $cfg('fhirDBDatabaseType');

                if (dbType == 'postgres') {
                return new java.sql.Timestamp(date.getTime());
                } else if (dbType == 'sqlserver') {
                return convertDate(date, 'yyyy-MM-dd HH:mm:ss.SSSZZ');
                } else {
                throw 'Unsupported DB type: ' + dbType;
                }
                }

/**
                Retrives the string value for a particular column from a ResultSet. Handles
                instances of
                java.sql.Clob and java.sql.Blob as well (with the JVM default charset).

                @param {ResultSet} resultSet - The ResultSet object to retrieve from.
                @param {String} columnName - The name or alias of the column to retrieve.
                @return {String} The string value.
                */
                function getResultSetString(resultSet, columnName) {
                var obj = resultSet.getObject(columnName);
                if (obj != null) {
                if (obj instanceof java.sql.Clob) {
                obj = org.apache.commons.io.IOUtils.toString(obj.getCharacterStream());
                } else if (obj instanceof java.sql.Blob) {
                obj = org.apache.commons.io.IOUtils.toString(obj.getBinaryStream());
                } else {
                obj = java.lang.String.valueOf(obj);
                }
                }
                return obj;
                }

/**
                These functions are used with the search interaction.
                */
                function getFhirSearchBaseQuery(usingLimit) {
                var dbType = $cfg('fhirDBDatabaseType');
                if (dbType == 'postgres') {
                return "SELECT name, id, version, data::TEXT, mimetype, request_method,
                request_url FROM resource r1 WHERE version = (SELECT MAX(version) FROM resource r2
                WHERE r2.name = r1.name AND r2.id = r1.id) AND (deleted IS NULL OR deleted =
                FALSE)";
                } else if (dbType == 'sqlserver') {
                var query = "SELECT name, id, version, CAST(data AS NVARCHAR(MAX)) AS data,
                mimetype, request_method, request_url";
                if (usingLimit) {
                query += ", ROW_NUMBER() OVER (" + getOrderClause() + ") AS
                ROWNUM";
                }
                return query + " FROM resource r1 WHERE version = (SELECT MAX(version) FROM
                resource r2 WHERE r2.name = r1.name AND r2.id = r1.id) AND (deleted IS NULL OR
                deleted = 0)";
                } else {
                throw 'Unsupported DB type: ' + dbType;
                }
                }

                function getFhirSearchContentWherePart() {
                var dbType = $cfg('fhirDBDatabaseType');
                if (dbType == 'postgres') {
                return "data::TEXT ILIKE ?";
                } else if (dbType == 'sqlserver') {
                return "UPPER(CAST(data AS NVARCHAR(MAX))) LIKE UPPER(?)";
                } else {
                throw 'Unsupported DB type: ' + dbType;
                }
                }

                function getFhirSearchLastUpdatedWherePart(lastUpdatedOperator) {
                var dbType = $cfg('fhirDBDatabaseType');
                if (dbType == 'postgres') {
                return "last_modified " +
                convertFhirParameterOperator(lastUpdatedOperator) + " ?::TIMESTAMP WITH TIME
                ZONE";
                } else if (dbType == 'sqlserver') {
                return "last_modified " +
                convertFhirParameterOperator(lastUpdatedOperator) + " CAST(? AS
                DATETIMEOFFSET)";
                } else {
                throw 'Unsupported DB type: ' + dbType;
                }
                }

                function convertFhirParameterOperator(operator) {
                switch ((operator + '').toLowerCase()) {
                case 'eq': return '=';
                case 'ne': return '!=';
                case 'gt': return '>';
                case 'lt': return '<';
                case 'ge': return '>=';
                case 'le': return '<=';
                case 'sa': return '>';
                case 'eb': return '<';
                case 'ap': return '=';
                default: return '=';
                }
                }

                function convertXPathNodeSingleton(node) {
                var dbType = $cfg('fhirDBDatabaseType');
                if (dbType == 'postgres') {
                return node;
                } else if (dbType == 'sqlserver') {
                return node.split('/').join('[1]/');
                } else {
                throw 'Unsupported DB type: ' + dbType;
                }
                }

                function xpathLowerCase(value) {
                var dbType = $cfg('fhirDBDatabaseType');
                if (dbType == 'postgres') {
                return "translate(" + value + ",
                'ABCDEFGHIJKLMNOPQRSTUVWXYZ',
                'abcdefghijklmnopqrstuvwxyz')";
                } else if (dbType == 'sqlserver') {
                return "fn:lower-case(" + value + ")";
                } else {
                throw 'Unsupported DB type: ' + dbType;
                }
                }

                function getFhirSearchXPathWherePart() {
                var dbType = $cfg('fhirDBDatabaseType');
                if (dbType == 'postgres') {
                return "XPATH_EXISTS(?, data)";
                } else if (dbType == 'sqlserver') {
                return "data.exist(?) = 1";
                } else {
                throw 'Unsupported DB type: ' + dbType;
                }
                }

                function addXPath(xpath, whereParts, params) {
                var dbType = $cfg('fhirDBDatabaseType');
                if (dbType == 'postgres') {
                whereParts.push(getFhirSearchXPathWherePart());
                params.push(xpath);
                } else if (dbType == 'sqlserver') {
                whereParts.push(getFhirSearchXPathWherePart().replace('?',
                "'" + xpath.replace(/'/g, "''") +
                "'"));
                } else {
                throw 'Unsupported DB type: ' + dbType;
                }
                }

                function addOrder(query, usingLimit) {
                var dbType = $cfg('fhirDBDatabaseType');
                if (dbType == 'postgres') {
                return query + " " + getOrderClause();
                } else if (dbType == 'sqlserver') {
                if (usingLimit) {
                return query;
                } else {
                return query + " " + getOrderClause();
                }
                } else {
                throw 'Unsupported DB type: ' + dbType;
                }
                }

                function getOrderClause() {
                return "ORDER BY name ASC, id ASC, version DESC";
                }

                function addLimit(query, limit) {
                var dbType = $cfg('fhirDBDatabaseType');
                if (dbType == 'postgres') {
                return query + " LIMIT " + limit;
                } else if (dbType == 'sqlserver') {
                return "SELECT A.* FROM (" + query + ") AS A WHERE A.ROWNUM <=
                " + limit;
                } else {
                throw 'Unsupported DB type: ' + dbType;
                }
                }

/**
                Returns a ResultSet for a specific resource instance at a specific version.

                @param {String} type - The FHIR resource type.
                @param {String} id - The logical ID of the resource.
                @param {Number} versionId - The version ID of the resource.
                @return {ResultSet} The ResultSet.
                */
                function getResourceVersion(type, id, versionId) {
                var params = [type, id, parseInt(versionId, 10)];
                var dbType = $cfg('fhirDBDatabaseType');

                if (dbType == 'postgres') {
                return executeCachedQuery("SELECT data::TEXT, mimetype, last_modified, deleted
                FROM resource WHERE name = ? AND id = ? AND version = ?", params);
                } else if (dbType == 'sqlserver') {
                return executeCachedQuery("SELECT CAST(data AS NVARCHAR(MAX)) AS data,
                mimetype, last_modified, deleted FROM resource WHERE name = ? AND id = ? AND version
                = ?", params);
                } else {
                throw 'Unsupported DB type: ' + dbType;
                }
                }

/**
                Supports parsing date strings in a variety of formats and outputting the date in a
                specific format.
                */
                var patterns = [
                "yyyy-MM-dd HH:mm:ss.SSSSSSS ZZ",
                "yyyy-MM-dd'T'HH:mm:ss.SSSZ",
                "yyyy-MM-dd'T'HH:mm:ssZ",
                "yyyy-MM-dd'T'HH:mm:ss",
                "yyyy-MM-dd'T'HH:mm",
                'yyyy-MM-dd',
                'yyyy-MM-dd HH:mm:ss:SSS',
                'yyyy-MM-dd HH:mm:ss.SSS',
                'yyyy-MM-dd HH:mm:ss',
                'yyyy-MM-dd HH:mm',
                'EEE MMM dd HH:mm:ss:SSS zzz yyyy',
                'EEE MMM dd HH:mm:ss.SSS zzz yyyy',
                'EEE MMM dd HH:mm:ss zzz yyyy',
                'EEE MMM dd zzz yyyy',
                'dd-MMM-yyyy HH:mm:ss:SSS',
                'dd-MMM-yyyy HH:mm:ss.SSS',
                'dd-MMM-yyyy HH:mm:ss',
                'yyyy MM dd',
                'yyyy.MM.dd',
                'MM-dd-yyyy',
                'MM dd yyyy',
                'MM.dd.yyyy',
                'HH:mm:ss:SSS',
                'HH:mm:ss.SSS',
                'HH:mm:ss',
                'yyyyMMddHHmmssSSS',
                'yyyyMMddHHmmss',
                'yyyyMMddHHmm',
                'hh:mm aa'];

                var formatters = [];
                for each (pattern in patterns) {
                formatters.push(org.joda.time.format.DateTimeFormat.forPattern(pattern));
                }

                function getMillis(date) {
                var instant = 0;
                if (typeof date == 'number' || date instanceof java.lang.Number)
                instant = new Number(date);
                else if (date instanceof Date || date instanceof java.util.Date)
                instant = date.getTime();
                else if (date instanceof org.joda.time.ReadableInstant)
                instant = date.getMillis();
                else {
                for each (formatter in formatters) {
                try {
                instant = formatter.parseMillis(new String(date));
                break;
                } catch(e) {}
                }
                }

                return instant;
                }

                function getDate(date) {
                return new java.util.Date(getMillis(date));
                }

                function convertDate(date, outpattern) {
                return
                org.joda.time.format.DateTimeFormat.forPattern(outpattern).print(getMillis(date));
                }

/**
                Creates a FHIR OperationOutcome resource and adds it to the response map with the
                key "response".

                @param {String} severity - Indicates whether the issue indicates a variation from
                successful
                processing. Values: fatal | error | warning | information
                @param {String} code - Describes the type of the issue. The system that creates an
                OperationOutcome SHALL choose the most applicable code from the IssueType value set,
                and may
                additional provide its own code for the error in the details element. Values:
                invalid | security |
                processing | transient | informational
                @param {String} details - Additional details about the error. This may be a text
                description of
                the error, or a system code that identifies the error.
                @param {String} fhirVersion - The FHIR version of the OperationOutcome resource.
                Values: DSTU2 | DSTU2_1 |
                DSTU_HL7ORG | STU3 | R4 | R5
                @param {int} httpStatusCode - The HTTP status code to send back with the response.
                Defaults to 400
                if not specified.
                @param {Error} e - If included, this will be used to build up the response status
                message and
                error.
                @param {Boolean} isFormatXML - If true, the resource will be formatted in XML.
                Otherwise, it will
                be formatted in JSON. If not specified, it will attempt to find the _format
                parameter in the source
                map, or return JSON.
                @return {Response} The created Response object.
                */
                function createOperationOutcome(severity, code, details, fhirVersion,
                httpStatusCode, e, isFormatXML) {
                if (!httpStatusCode) {
                httpStatusCode = 400;
                }

                if (!isFormatXML && $s('parameters') &&
                $s('parameters').contains('_format')) {
                isFormatXML =
                !FhirUtil.isJSON($s('parameters').getParameter('_format'));
                }

                var outcome = FhirUtil.createOperationOutcome(severity, code, details, fhirVersion);
                var message = isFormatXML ? FhirUtil.toXML(outcome, fhirVersion) :
                FhirUtil.toJSON(outcome, fhirVersion);
                responseMap.put('response', FhirResponseFactory.getResponse(message,
                httpStatusCode, isFormatXML ? FhirUtil.getMIMETypeXML() :
                FhirUtil.getMIMETypeJSON()));
                var response = new Response(message);
                response.setStatusMessage(severity.toUpperCase() + ' OperationOutcome created
                with status ' + httpStatusCode + '.');

                if (httpStatusCode >= 400) {
                response.setStatus(Status.ERROR);

                if (e) {
                var customMessage = 'Channel ' + channelName + ': ';
                if (e.rhinoException) {
                customMessage += 'Error on line ' + e.rhinoException.lineNumber() +
                ': ';
                }
                customMessage += e.toString();

                var errorContent =
                com.mirth.connect.util.ErrorMessageBuilder.buildErrorMessage('FHIR
                Listener', customMessage, e.javaException || null);
                if (e.javaException) {
                logger.error(errorContent, e.javaException);
                } else {
                logger.error(errorContent);
                }
                response.setError(errorContent);
                }
                }

                return response;
                }

/**
